            elif num % 20 < 10:
                Ans[1] = 1
            else:
                Ans[0] = 1
        cnt = 0
        for i in Ans:
            if i == -1:
                cnt += 1
        if cnt != 2:
            check = False
        if check:
            results.append('Yes')
        else:
            results.append('No')
    return results

