                if Ans[2] == -1:
                    Ans[2] = num + 5
                elif Ans[2] != num + 5:
                    check = False
                    break
            elif num % 10 in A1:
                if num % 20 < 10:
                    Ans[0] = 1
                else:
                    Ans[1] = 1
            elif num % 20 < 10:
                Ans[1] = 1
            else:
                Ans[1] = 1
        cnt = 0
        for i in Ans:
            if i == -1:
                cnt += 1
        if cnt != 2:
            check = False
        if check:
            results.append('Yes')
        else:
            results.append('No')
    return results
